from scripts.const import ports_and_protocols, ics_vendor_list
from u_utils import list_of_bool_int_fields, enumerated_field


def meta_features(machine, field_prefix):
    res = []
    res += list_of_bool_int_fields(machine,
                                   parent_field=field_prefix,
                                   child_fields=['support',
                                                 'function_code',
                                                 'mei_response_conformity_level'],
                                   description='meta autmomated modbus features')

    res += enumerated_field(machine,
                            field='{}_metadata_description'.format(field_prefix),
                            enum_list=ics_vendor_list,
                            add_fields=['{}_mei_response_objects_model_name'.format(field_prefix),
                                        '{}_mei_response_objects_product_name'.format(field_prefix),
                                        '{}_mei_response_objects_user_application_name'.format(field_prefix),
                                        '{}_mei_response_objects_vendor'.format(field_prefix)])
    return res


def extract(machine, args):
    # todo some other possible interesting features here
    res = []
    protocol = 'modbus'
    ports = [p for c in ports_and_protocols
             if c[0] == protocol
             for p in c[1]]
    for port in sorted(ports, reverse=True):
        prefix = 'p{}_{}_device_id'.format(port, protocol)
        res += meta_features(machine, prefix)
    return res


